import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';

import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import SignIn from './SignIn'; //SignIn Page
import SignUp from './SignUp'; //SignUp Page
import Profile from './Profile'; // Profile Page

const Stack = createStackNavigator();

const App = () => {
  const [userData, setUserData] = useState(null);

  const handleSignIn = async (email, password) => {
    try {
      const response = await axios.post('http://localhost:3000/login', {
        email,
        password,
      });

      if (response.data.message === 'passed') {
        // Authentication successful, you can set user data or token here
        // For example, setUserData(response.data.user);
        // Then navigate to the desired screen.
      } else {
        // Authentication failed, show an error message to the user
        console.log('Login failed');
      }
    } catch (error) {
      // Handle network errors
      console.error('Error:', error);
    }
  };

  return (
   <NavigationContainer>
      <Stack.Navigator initialRouteName="SignIn">
        <Stack.Screen name="SignIn">
          {(props) => <SignIn {...props} handleSignIn={handleSignIn} />}
        </Stack.Screen>
        <Stack.Screen name="SignUp" component={SignUp} />
        <Stack.Screen name="Profile" component={Profile} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
